CREATE DEFINER=`CS467_Master`@`%` FUNCTION `wcFct_ReturnHostNameFromUrl`(urlIn text) RETURNS text CHARSET latin1
BEGIN
	DECLARE hostname text;
    SET hostname = "UNDEFINED";
	SET hostname = (SELECT replace((replace((SUBSTRING_INDEX(SUBSTRING_INDEX(REPLACE(urlIn, '//', ''), '/', 1), '*', -2)), 'http:','')),'https:',''));
RETURN hostname;
END ;;
