CREATE DEFINER=`CS467_Master`@`%` PROCEDURE `TEST_wcSp_DeleteOldSearches`()
BEGIN

 -- Set up 
    SET @resLocal = -99; SET @countLocal = -99;
	SET @url1 = CONCAT('http://', CONCAT(CAST(unix_timestamp() AS char), '1'));
	SET @url2 = CONCAT('http://', CONCAT(CAST(unix_timestamp() AS char), '2'));
	SET @url3 = CONCAT('http://', CONCAT(CAST(unix_timestamp() AS char), '3'));
	SET @url4 = CONCAT('http://', CONCAT(CAST(unix_timestamp() AS char), '4'));
	IF (SELECT COUNT(Id) FROM wc_UserSearches) = 0 THEN
		SET @maxCookie = 0;
	ELSE 
		SET @maxCookie = (SELECT MAX(CookieId) FROM wc_UserSearches);
    END IF;
    
    -- Insert the edges and then the tree 
	INSERT INTO wc_TempEdges(SorcUrl, SorcTitle, DestUrl, DestTitle, CookieId, 
					User, SrchType, SrchDepth, RootUrl, RootTitle, KeywordText, KeywordUrl, KeywordUrlTitle)   
	VALUES(@url1, 'STITLE', @url2, 'DTITLE', (@maxCookie + 1), 'TESTUSER', 'TESTTYPE', 22, 'TESTROOT', 
			'RTITLE', 'TESTKWTXT', 'TESTKWURL', 'KWTITLE'), 
	(@url3, 'STITLE', @url4, 'DTITLE', (@maxCookie + 1), 'TESTUSER', 'TESTTYPE', 22, 'TESTROOT', 
			'RTITLE', 'TESTKWTXT', 'TESTKWURL', 'KWTITLE');
	
    -- Update the time on the user searches table to make them old since they are automagically 
    -- assigned inside the stored procedures called above 
    SET @urlId = (SELECT Id FROM wc_Urls WHERE Url = 'TESTROOT'); 
    SET @userId = (SELECT Id FROM wc_Users WHERE `Name` = 'TESTUSER');
    SET @kwtextId = (SELECT Id FROM wc_SearchKeywords WHERE SearchKeyword = 'TESTKWTXT');
	SET @kwurlId = (SELECT Id FROM wc_Urls WHERE Url = 'TESTKWURL'); 
    SET @timeLimit = (SELECT `Value` FROM wc_Configuration WHERE Id = 1) + 34;
    UPDATE wc_UserSearches SET TimeOfSearch = DATE_SUB(TimeOfSearch, INTERVAL @timeLimit DAY)
    WHERE CookieId = (@maxCookie + 1) AND UserId = @userId AND SearchType = 'TESTTYPE' AND 
    SearchDepth = 22 AND RootUrlId = @urlId AND KeywordId = @kwtextId AND KeywordUrlId = @kwurlId;
    
    -- Call the PUT and verify results 
	CALL wcSp_DeleteOldSearches(); 
	CALL wcSp_DoesSearchExist((@maxCookie + 1), 'TESTUSER', 'TESTTYPE', 22, 'TESTROOT', 'TESTKWTXT', 'TESTKWURL', @resLocal2); 
	SELECT IF(@resLocal2 = 0, 'PASSED', 'FAILED') AS `wcSp_DeleteOldSearches`;

    -- Clean up the tables so we leave no trace 
	SET SQL_SAFE_UPDATES = 0;
	DELETE FROM wc_SingleGraphs WHERE UserSearchId = (SELECT Id FROM wc_UserSearches WHERE CookieId = @maxCookie + 1);
	DELETE FROM wc_UserSearches WHERE CookieId = @maxCookie + 1;
    DELETE FROM wc_SearchKeywords WHERE SearchKeyword = 'TESTKWTXT';
	DELETE FROM wc_TempEdges WHERE DestUrl IN(@url1, @url2, @url3, @url4);
	DELETE FROM wc_TempEdges WHERE SorcUrl IN(@url1, @url2, @url3, @url4);
