	INSERT INTO wc_Urls(`Url`, `HostName`, `Title`) VALUES('TESTKWURL', 'TESTHOST2', 'TESTKWURLTITLE');	
    IF (SELECT COUNT(Id) FROM wc_UserSearches) = 0 THEN
		SET @maxCookie = 0;
	ELSE 
		SET @maxCookie = (SELECT MAX(CookieId) FROM wc_UserSearches);
    END IF;

	-- Call the PUT 
	CALL wcSp_InsertSearch((@maxCookie + 1), 'TESTUSER', 'TESTTYPE', 12, 'TESTROOT', 'TESTKWTXT', 'TESTKWURL', @resLocal);

	-- Test the results 
	SET @countLocal = (SELECT COUNT(Id) FROM wc_UserSearches WHERE CookieId = (@maxCookie + 1));
	SELECT IF(@resLocal = 1 AND @countLocal = 1, 'PASSED', 'FAILED') AS `wcSp_InsertSearch`;

	-- Clean up 
	DELETE FROM wc_Users WHERE `Name` = 'TESTUSER';
	DELETE FROM wc_Urls WHERE Url IN ('TESTROOT', 'TESTKWURL');
    DELETE FROM wc_SearchKeywords WHERE SearchKeyword = 'TESTKWTXT';
	DELETE FROM wc_UserSearches WHERE CookieId = (@maxCookie + 1); 
