CREATE DEFINER=`CS467_Master`@`%` PROCEDURE `TEST_wcSp_ReturnSetOfDestUrlsForSrc`()
BEGIN

   -- Set up 
    SET @resLocal = -99; SET @countLocal = -99;
	SET @url1 = CONCAT('http://', CONCAT(CAST(unix_timestamp() AS char), '1'));
	SET @url2 = CONCAT('http://', CONCAT(CAST(unix_timestamp() AS char), '2'));
	SET @url3 = CONCAT('http://', CONCAT(CAST(unix_timestamp() AS char), '3'));
	SET @url4 = CONCAT('http://', CONCAT(CAST(unix_timestamp() AS char), '4'));
	IF (SELECT COUNT(Id) FROM wc_UserSearches) = 0 THEN
		SET @maxCookie = 0;
	ELSE 
		SET @maxCookie = (SELECT MAX(CookieId) FROM wc_UserSearches);
    END IF;
        
    -- Insert the edges and then the tree 
	INSERT INTO wc_TempEdges(SorcUrl, SorcTitle, DestUrl, DestTitle, 
			CookieId, User, SrchType, SrchDepth, RootUrl, RootTitle, KeywordText, KeywordUrl, KeywordUrlTitle)   
	VALUES(@url1, 'STITLE', @url2, 'DTITLE', (@maxCookie + 1), 'TESTUSER', 
			'TESTTYPE', 22, 'TESTROOT', 'RTITLE', 'TESTKWTXT', 'TESTKWURL', 'TESTKWTITLE'), 
	(@url1, 'STITLE', @url3, 'DTITLE', (@maxCookie + 1), 'TESTUSER', 
			'TESTTYPE', 22, 'TESTROOT', 'RTITLE', 'TESTKWTXT', 'TESTKWURL', 'TESTKWTITLE'), 
	(@url1, 'STITLE', @url4, 'DTITLE', (@maxCookie + 1), 'TESTUSER', 
			'TESTTYPE', 22, 'TESTROOT', 'RTITLE', 'TESTKWTXT', 'TESTKWURL', 'TESTKWTITLE');
	CALL wcSp_InsertNewTree('TESTROOT', 'TESTUSER', (@maxCookie + 1), 'TESTTYPE', 22, 'TESTKWTXT', 'TESTKWURL', @resLocal);
	
    -- Call the PUT - there is no way of putting the results of a stored procedure that 
    -- returns a data set into a table so we just need to manually verify.
	CALL wcSp_ReturnSetOfDestUrlsForSrc(@url1);
    
    -- Clean up the tables so we leave no trace 
	SET SQL_SAFE_UPDATES = 0;
	DELETE FROM wc_SingleGraphs WHERE UserSearchId = (SELECT Id FROM wc_UserSearches WHERE CookieId = @maxCookie + 1);
	DELETE FROM wc_UserSearches WHERE CookieId = @maxCookie + 1;
	DELETE FROM wc_TempEdges WHERE DestUrl IN(@url1, @url2, @url3, @url4);
	DELETE FROM wc_TempEdges WHERE SorcUrl IN(@url1, @url2, @url3, @url4);
	DELETE FROM wc_Edges WHERE SorcUrlId IN (SELECT Id FROM wc_Urls WHERE Url IN(@url1, @url2, @url3, @url4));
	DELETE FROM wc_Edges WHERE DestUrlId IN (SELECT Id FROM wc_Urls WHERE Url IN(@url1, @url2, @url3, @url4));
	DELETE FROM wc_Urls WHERE Url IN(@url1, @url2, @url3, @url4, 'TESTROOT', 'TESTKWURL');
    DELETE FROM wc_SearchKeywords WHERE SearchKeyword = 'TESTKWTXT';
	DELETE FROM wc_Users WHERE `Name` = 'TESTUSER';
	SET SQL_SAFE_UPDATES = 1;


END ;;
DELIMITER ;
