CREATE DEFINER=`CS467_Master`@`%` PROCEDURE `wcSp_DeleteOldSearches`()
BEGIN

    -- Delete the edges that are old 
	SET SQL_SAFE_UPDATES = 0;
	DELETE FROM wc_SingleGraphs 
	WHERE UserSearchId IN
	(SELECT Id FROM wc_UserSearches
	WHERE DATEDIFF(NOW(), TimeOfSearch) >= (SELECT `Value` FROM wc_Configuration WHERE Id = 1));
	
	-- Delete the actual searches that are old 
	DELETE FROM wc_UserSearches
	WHERE DATEDIFF(NOW(), TimeOfSearch) >= (SELECT `Value` FROM wc_Configuration WHERE Id = 1);
	SET SQL_SAFE_UPDATES = 1;

END ;;
