CREATE DEFINER=`CS467_Master`@`%` PROCEDURE `wcSp_DoesSearchExist`(	
																		IN cookie int, 
																		IN user varchar(255),
																		IN srchtype varchar(255), 
																		IN srchdepth int, 
																		IN root text, 
                                                                        IN kwordtext text,
                                                                        IN kwordurl text,
																		OUT result int
																	)
BEGIN

	-- Get the user id and the root id and the keyword text id and the keyword url id
    SET @userId = (SELECT Id FROM wc_Users WHERE `Name` = user);
    SET @rootId = (SELECT Id FROM wc_Urls WHERE Url = root);
    SET @kwTextId = (SELECT Id FROM wc_SearchKeywords WHERE SearchKeyword = kwordtext);
    SET @kwUrlId = (SELECT Id FROM wc_Urls WHERE Url = kwordurl);

	-- Return the number of records from wc_UserSearches 
    -- that meet all the criteria passed in
	SET result = 
    (SELECT COUNT(Id) AS `Count`
    FROM wc_UserSearches
    WHERE CookieId = cookie 
    AND UserId = @userId 
    AND SearchType = srchtype 
    AND SearchDepth = srchdepth 
    AND RootUrlId = @rootId
    AND KeywordId = @kwTextId 
    AND KeywordUrlId = @kwUrlId
    AND DATEDIFF(NOW(), TimeOfSearch) <= (SELECT `Value` FROM wc_Configuration WHERE Id = 1));
    
    -- Call the clean up procedure 
    CALL wcSp_DeleteOldSearches();

END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
