CREATE DEFINER=`CS467_Master`@`%` PROCEDURE `wcSp_GetExistingTree`(
																		IN cookie int, 
																		IN user varchar(255),
																		IN srchtype varchar(255), 
																		IN srchdepth int, 
																		IN root text,
                                                                        IN kwordtext text,
                                                                        IN kwordurl text
																	)
BEGIN

	-- Perform the mega join 
	SELECT US.CookieId, U.Name AS `User`, US.SearchType, US.SearchDepth,
	URL.Id AS `RootId`, URL.Url AS `RootUrl`, URL.HostName AS `RootHost`, URL.Title AS `RootTitle`,
    SKW.SearchKeyword AS `Keyword Text`, URLKW.Url AS `Keyword Url`, URLKW.HostName AS `KwUrlHost`, URLKW.Title AS `KwUrlTitle`,
    URLS.Id AS `SourceId`, URLS.Url AS `SourceUrl`, URLS.HostName AS `SourceHost`, URLS.Title AS `SourceTitle`,
    URLD.Id AS `DestinationId`, URLD.Url AS `DestinationUrl`, URLD.HostName AS `DestinationHost`, URLD.Title AS `DestinationTitle`
	FROM wc_UserSearches US
	INNER JOIN wc_SingleGraphs SG ON US.Id = SG.UserSearchId
	INNER JOIN wc_Edges E ON SG.Edge = E.Id
	INNER JOIN wc_Urls URL ON US.RootUrlId = URL.Id
	INNER JOIN wc_Users U ON US.UserId = U.Id
	INNER JOIN wc_Urls URLS ON E.SorcUrlId = URLS.Id
	INNER JOIN wc_Urls URLD ON E.DestUrlId = URLD.Id
    INNER JOIN wc_SearchKeywords SKW ON US.KeywordId = SKW.Id
    INNER JOIN wc_Urls URLKW ON US.KeywordUrlId = URLKW.Id 
	WHERE US.CookieID = cookie 
    AND U.Name = user 
    AND US.SearchType = srchtype
    AND US.SearchDepth = srchdepth
    AND URL.Url = root
    AND SKW.SearchKeyword = kwordtext 
    AND URLKW.Url = kwordurl;

END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
