CREATE DEFINER=`CS467_Master`@`%` PROCEDURE `wcSp_InsertEdge`(
																	IN sorc text, 
																	IN stitle text, 
																	IN dest text,
                                                                    IN dtitle text,
																	OUT result int
																)
BEGIN
	DECLARE present int;
    DECLARE sId int;
    DECLARE dId int;
    DECLARE resLocal int;
    SET resLocal = -99;

	-- First insert the two urls into the url table. This SP checks for presence 
    CALL wcSp_InsertUrl(sorc, stitle, resLocal);
    CALL wcSp_InsertUrl(dest, dtitle, resLocal);
    
	-- Get the ID of the two urls just inserted 
    SET sId = (SELECT Id FROM wc_Urls WHERE Url = sorc);
    SET dId = (SELECT Id FROM wc_Urls WHERE Url = dest);
    
	-- Check to make sure the edge does not already exist
    SET present = 0;
    SET present = 
	(
		SELECT COUNT(Id) FROM wc_Edges
		WHERE SorcUrlId = sId AND DestUrlId = dId
	);

    -- The edge is not present so insert otherwise do nothing 
    IF present = 0 THEN
		INSERT INTO wc_Edges(SorcUrlId, DestUrlId, LastTime) 
		VALUES(sId, dId, (SELECT NOW())); 
    END IF;

    -- Send back the result 
    SET result = 	(SELECT COUNT(Id) FROM wc_Edges WHERE SorcUrlId = sId AND DestUrlId = dId);

END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
