CREATE DEFINER=`CS467_Master`@`%` PROCEDURE `wcSp_InsertEdgeSingleGraph`(
																				IN cookie INT,
                                                                                IN username varchar(255),
																				IN stype varchar(255),
																				IN sdepth int,
																				IN root text,
                                                                                IN rtitle text,
                                                                                IN kwtext text,
                                                                                IN kwurl text,
                                                                                IN kwurltitle text,
                                                                                IN sorc text,
                                                                                IN stitle text,
                                                                                IN dest text, 
                                                                                IN dtitle text,
                                                                                OUT result int
																			)
BEGIN
	DECLARE sId int(11); -- Source id from url table
    DECLARE dId int(11); -- Dest id from url table 
	DECLARE eId int(11); -- Edge id from the edge table 
    DECLARE rId int(11); -- Root url id 
    DECLARE kwtxtId int(11); -- Keyword text id
    DECLARE kwurlId int(11); -- Keyword url id 
    DECLARE usrId int(11); -- User id 
    DECLARE uId int(11); -- Search id frm the user search table 
    DECLARE present int; -- Local flag variable 
    DECLARE resLocal int;  -- Output parameter for client flagging 
    SET resLocal = -99;
		
	-- Insert into the edge table which also checks for presence just to make sure.
	-- InsertEdge also inserts the urls as a precondition so dont need to do it here
    CALL wcSp_InsertEdge(sorc, stitle, dest, dtitle, resLocal);
    
    -- Get the edge id with the two end point url ids
    SET sId = (SELECT Id FROM wc_Urls WHERE Url = sorc);
    SET dId = (SELECT Id FROM wc_Urls WHERE Url = dest);
    SET rId = (SELECT Id FROM wc_Urls WHERE Url = root);
    SET kwtxtId = (SELECT Id FROM wc_SearchKeywords WHERE SearchKeyword = kwtext);
    SET kwurlId = (SELECT Id FROM wc_Urls WHERE Url = kwurl);
	SET usrId = (SELECT Id FROM wc_Users WHERE `Name` = username);
    SET eId = (SELECT Id FROM wc_Edges WHERE SorcUrlId = sId AND DestUrlId = dId);
    SET uId = (SELECT Id FROM wc_UserSearches WHERE CookieId = cookie AND 
				UserId = usrId AND SearchType = stype AND SearchDepth = sdepth AND RootUrlId = rId); 

	-- Check to make sure the edge does not already exist for this specific search
    SET present = 0;
    SET present = 
	(
		SELECT COUNT(Id) FROM wc_SingleGraphs
		WHERE Edge = eId AND Id = uId
	);
    
    -- The edge is not present so insert into the single graphs table  
    IF present = 0 THEN
		INSERT INTO wc_SingleGraphs(UserSearchId, Edge) 
		VALUES(uId, eId);
    END IF;
    
    -- Send back the result 
    SET result = (SELECT COUNT(Id) FROM wc_SingleGraphs WHERE Edge = eId AND UserSearchId = uId);
	
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
