CREATE DEFINER=`CS467_Master`@`%` PROCEDURE `wcSp_InsertIntoTempEdges`(
																			IN s text, 
                                                                            IN sTitle text,
																			IN d text,
																			IN dTitle text,
                                                                            IN cookie int,
                                                                            IN username varchar(255),
																			IN stype varchar(255),
																			IN sdepth int,
																			IN root text,
                                                                            IN rTitle text,
																			IN kwordtext text,
																			IN kwordurl text,  
                                                                            IN kwUrlTitle text,
                                                                            OUT result int
																		)
BEGIN

	DECLARE present int;
    SET present = 0;
    SET present = 
	(
		SELECT COUNT(Id) FROM wc_TempEdges
		WHERE SorcUrl = s AND SorcTitle = sTitle AND DestUrl = d AND DestTitle = dTitle AND CookieId = cookie AND 
        User = username AND SrchType = stype AND SrchDepth = sDepth AND RootUrl = root AND RootTitle = rTitle
        AND KeywordText = kwordtext AND KeywordUrl =  kwordurl AND KeywordUrlTitle = kwUrlTitle
	);
    
    IF present = 0 THEN
		INSERT INTO wc_TempEdges(SorcUrl, SorcTitle, DestUrl, DestTitle, CookieId, User, SrchType, SrchDepth, 
								RootUrl, RootTitle, KeywordText, KeywordUrl, KeywordUrlTitle) 
        VALUES(s, sTitle, d, dTitle, cookie, username, stype, sdepth, root, rTitle, kwordtext, kwordurl, kwUrlTitle);
	END IF;
    
    SET result = 	(SELECT COUNT(Id) FROM wc_TempEdges
		WHERE SorcUrl = s AND SorcTitle = sTitle AND DestUrl = d AND DestTitle = dTitle AND CookieId = cookie AND 
        User = username AND SrchType = stype AND SrchDepth = sDepth AND RootUrl = root AND RootTitle = rTitle
        AND KeywordText = kwordtext AND KeywordUrl =  kwordurl AND KeywordUrlTitle = kwUrlTitle);
                    
END ;;
