CREATE DEFINER=`CS467_Master`@`%` PROCEDURE `wcSp_InsertNewTree`(	
																	IN root text, 
																	IN userIn varchar(255), 
																	IN cookie int, 
																	IN typeIn varchar(255),
																	IN depthIn int,
																	IN kwordtext text,
																	IN kwordurl text,
                                                                    OUT result int
																)
BEGIN
	
    -- Locals 
	DECLARE idx int;
    DECLARE s text;
    DECLARE d text;
    DECLARE rt text; 	-- Title from temp table based on url 
    DECLARE st text; 	-- Same as previous 
    DECLARE dt text; 	-- Same as previous 
    DECLARE kwut text; 	-- Same as previous 
    DECLARE numrows int;
    DECLARE resLocal int;
	DECLARE uId int;
    DECLARE rId int;
    DECLARE kwtxtId int;
    DECLARE kwurlId int;
    SET idx = 1;
    SET numrows = 0;
    SET resLocal = -99;
    
    SET rt = (SELECT RootTitle FROM wc_TempEdges WHERE RootUrl = root LIMIT 1);
    SET kwut = (SELECT KeywordUrlTitle FROM wc_TempEdges WHERE KeywordUrl = kwordurl LIMIT 1);

	-- Store the root url - checks for uniqueness
    CALL wcSp_InsertUrl(root, rt, resLocal);
    
    -- Store the user - checks for uniqueness
    CALL wcSp_InsertUser(userIn, resLocal);
    
    -- Store the keyword text 
    CALL wcSp_InsertKeyword(kwordtext, reslocal);
    
    -- Store the keyword url 
    CALL wcSp_InsertUrl(kwordurl, kwut, resLocal);
    
    -- Store the search id - checks for uniqueness. Also blows out the record if it 
    -- already exists 
    CALL wcSp_InsertSearch(cookie, userIn, typeIn, depthIn, root, kwordtext, kwordurl, resLocal);
    
    -- Create temp table with the contents from TempEdges where the search criteria match
    SET SQL_SAFE_UPDATES = 0; -- turn off safe
    DROP TABLE IF EXISTS edges;
    CREATE TEMPORARY TABLE edges	(
										id int NOT NULL, 
										sorc text NOT NULL, 
										stitle text NOT NULL, 
										dest text NOT NULL, 
										dtitle text NOT NULL,
										cookie int NOT NULL, 
										usr varchar(255) NOT NULL, 
										stype varchar(255) NOT NULL, 
										sdepth int NOT NULL, 
										root text NOT NULL, 
										rtitle text NOT NULL, 
										kwtxt text, kwurl text, 
										kwurltitle text
									);
	INSERT INTO edges(id, sorc, stitle, dest, dtitle, cookie, usr, stype, sdepth, root, rtitle, kwtxt, kwurl, kwurltitle) 
    (SELECT * FROM wc_TempEdges WHERE CookieId = cookie AND User = userIn AND SrchType = typeIn 
    AND SrchDepth = depthIn AND RootUrl = root AND KeywordText = kwordtext AND KeywordUrl = kwordurl);
    
    -- Loop over the temp table storing the edges and deleting the row in temp table
    -- and also storing in the single graph table.
	SET numrows = (SELECT COUNT(id) FROM edges);
    SET idx = 1;
	WHILE numrows >= idx DO
		SET s = (SELECT sorc FROM edges ORDER BY id LIMIT 1);
		SET st = (SELECT stitle FROM edges WHERE sorc = s LIMIT 1);
        SET d = (SELECT dest FROM edges ORDER BY id LIMIT 1);
		SET dt = (SELECT dtitle FROM edges WHERE dest = d LIMIT 1);
        CALL wcSp_InsertEdgeSingleGraph(cookie, userIn, typeIn, depthIn, root, rt, kwordtext, kwordurl, kwut, s, st, d, dt, resLocal);
        DELETE FROM edges WHERE sorc = s AND dest = d;
        SET idx = idx + 1;
    END WHILE;
    DROP TABLE IF EXISTS edges;
    
    -- Delete rows in wc_TempEdges where all fields match
    DELETE FROM wc_TempEdges WHERE CookieId = cookie AND User = userIn AND SrchType = typeIn 
    AND SrchDepth = depthIn AND RootUrl = root AND KeywordText = kwordtext AND KeywordUrl = kwordurl;
    
    -- Return the number of records that have been inserted 
    SET uId = (SELECT Id FROM wc_Users WHERE `Name` = userIn);
    SET rId = (SELECT Id FROM wc_Urls WHERE Url = root);
    SET kwtxtId = (SELECT Id FROM wc_SearchKeywords WHERE SearchKeyword = kwordtext);
	SET kwurlId = (SELECT Id FROM wc_Urls WHERE Url = kwordurl);
    SET result = 	(SELECT COUNT(Id) FROM wc_SingleGraphs WHERE UserSearchId = 
					(SELECT Id FROM wc_UserSearches WHERE CookieId = cookie AND UserId = uId AND SearchType = typeIn AND
                    SearchDepth = depthIn AND RootUrlId = rId AND KeywordId = kwtxtId AND KeyWordUrlId = kwurlId));
    
    -- Reset to safe 
    SET SQL_SAFE_UPDATES = 1;
END ;;
DELIMITER ;
