CREATE DEFINER=`CS467_Master`@`%` PROCEDURE `wcSp_InsertSearch`(
																	IN cookie INT(11), 
                                                                    IN userName varchar(255), 
                                                                    IN sType varchar(255), 
                                                                    IN sDepth INT(11), 
                                                                    IN root text, 
																	IN kwordtext text,
																	IN kwordurl text,
                                                                    OUT result int
																)
BEGIN
	DECLARE usrId int;
	DECLARE urlId int;
	DECLARE kwtextId int;
	DECLARE kwurlId int;
	DECLARE curTime datetime;
    DECLARE present int;
    SET present = 0;
	SET SQL_SAFE_UPDATES = 0;
    
	-- Get the user id 
	SET usrId = (SELECT Id FROM wc_Users WHERE Name = userName);
	
	-- Get the root urlId 
	SET urlId = (SELECT Id FROM wc_Urls WHERE Url = root);
    
	-- Get the keyword text id 
	SET kwtextId = (SELECT Id FROM wc_SearchKeywords WHERE SearchKeyword = kwordtext);

	-- Get the keyword url id 
	SET kwurlId = (SELECT Id FROM wc_Urls WHERE Url = kwordurl);
	
	-- Get the current sys time 
	SET curTime = (SELECT NOW());
	
	-- Do the insert 
    SET present = 0;
    SET present = 
	(
		SELECT COUNT(Id) FROM wc_UserSearches
		WHERE CookieId = cookie AND UserId = usrId AND SearchType = sType AND 
        SearchDepth = sDepth AND RootUrlId = urlId AND KeywordId = kwtextId AND KeywordUrlId = kwurlId
	);
    IF present = 1 THEN
		DELETE FROM wc_UserSearches WHERE CookieId = cookie AND UserId = usrId AND 
        SearchType = sType AND SearchDepth = sDepth AND RootUrlId = urlId
        AND KeywordId = kwtextId AND KeywordUrlId = kwurlId;
		INSERT INTO wc_UserSearches(CookieId, UserId, SearchType, SearchDepth, 
								RootUrlId, KeywordId, KeywordUrlId, TimeOfSearch) 
        VALUES(cookie, usrId, sType, sDepth, urlId, kwtextId, kwurlId, curTime);
    ELSE
		INSERT INTO wc_UserSearches(CookieId, UserId, SearchType, SearchDepth, 
								RootUrlId, KeywordId, KeywordUrlId, TimeOfSearch) 
        VALUES(cookie, usrId, sType, sDepth, urlId, kwtextId, kwurlId, curTime);
	END IF;
    
    -- Return the number of records that meet the insert criteria
    SET result = (SELECT COUNT(Id) FROM wc_UserSearches 
    WHERE CookieId = cookie AND UserId = usrId AND 
    SearchType = sType AND SearchDepth = sDepth AND RootUrlId = urlId
    AND KeywordId = kwtextId AND KeywordUrlId = kwurlId);
    
	-- Reset to safe 
    SET SQL_SAFE_UPDATES = 1;
END ;;
DELIMITER ;
