CREATE DEFINER=`CS467_Master`@`%` PROCEDURE `wcSp_InsertUrl`(IN urlIn text, IN titleIn text, OUT result int)
BEGIN
	-- NOTE:
    -- We always assume the newest insert is the most correct. So if a title disappears or 
    -- appears we do the insert.
	
	-- Check if present only against the URL and if not insert.
    DECLARE present int;
    SET present = 0;
    SET present = 
	(
		SELECT COUNT(Id) FROM wc_Urls
		WHERE Url = urlIn
	);
    IF present = 0 THEN -- Do the insert if not present at all
		INSERT INTO wc_Urls(`Url`, `HostName`, `Title`) VALUES(urlIn, wcFct_ReturnHostNameFromUrl(urlIn), titleIn);	
	ELSE -- Do an update if the URL is there - assume new information is most correct
		UPDATE wc_Urls SET `Url` = urlIn, `HostName` = (wcFct_ReturnHostNameFromUrl(urlIn)), `Title` = titleIn
        WHERE `Url` = urlIn; 	
	END IF;
    
    -- Return the result. Should only be 0 or 1. If more than 1 we have a problem. 
    SET result = (SELECT COUNT(Id) FROM wc_Urls WHERE Url = urlIn);
END ;;
DELIMITER ;
