CREATE DEFINER=`CS467_Master`@`%` PROCEDURE `wcSp_ReturnSetOfDestUrlsForSrc`(IN sorc text)
BEGIN
	DECLARE srcId int;
    
    -- Get the source id from the url table 
    SET srcId = (SELECT Id FROM wc_Urls WHERE Url = sorc);
    
    -- Get the list of destinations that have the incoming 
    -- source as the source 
	SELECT u.Url AS 'DestUrl', u.HostName AS 'DestHost', u.Title AS 'DestTitle' 
    FROM wc_Edges e 
	INNER JOIN wc_Urls u ON e.DestUrlId = u.Id
	WHERE SorcUrlId = srcId;
END ;;
